import Link from "next/link";
import "./Menu.scss";
import GlobalStyles from "../styles/GlobalStyles";

const Menu = () => (
  <div className="menu">
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>
    <Link href="/design">
      <a>Design</a>
    </Link>
    <GlobalStyles props={true} />
  </div>
);

export default Menu;
